import React from 'react';
import s from '../../App.module.scss';
import GenreBar from './GenreBar';
import ProductsList from './ProductsList';
import styles from './shop.module.scss'
import WriterBar from './WriterBar';
import ShopSideBar from './WriterBar';

const Shop = (props) => {
    let state = props.productsPage;
    return (
    <div className={`${styles.shop} ${s.component}`}>
      
      <WriterBar productsPage={props.productsPage} 
      setSelectedWriter={props.setSelectedWriter} />

      <div className={s.container}>
        <GenreBar productsPage={props.productsPage} 
        setSelectedGenre={props.setSelectedGenre} />
        <div className={styles.products}>

          <ProductsList productsPage={props.productsPage}  />
        </div>
      </div>
    </div>
    )
}

export default Shop;
